import { Component, ViewChild } from '@angular/core';
import { IonicPage, NavController, NavParams, AlertController, Navbar } from 'ionic-angular';
import { AuthProvider } from '../../providers/auth/auth';
import { UserProvider } from '../../providers/user/user';
import { OrdersProvider } from '../../providers/orders/orders';
import { CartProvider } from '../../providers/cart/cart';
import { AngularFireAuth } from 'angularfire2/auth';
import { AngularFirestore } from 'angularfire2/firestore';
import { CollectionConstants } from '../../common/constants/CollectionConstants';
import { ToastProvider } from '../../providers/toast/toast';
import { MessageConstants } from '../../common/constants/MessageConstants';
import { Geolocation } from '@ionic-native/geolocation';
import { LocationAccuracy } from '@ionic-native/location-accuracy';
import { OpenNativeSettings } from '@ionic-native/open-native-settings';
import * as geofirex from 'geofirex';
import * as firebaseApp from 'firebase/app';
import { CommonProvider } from '../../providers/common/common';
import { SocialSharing } from '@ionic-native/social-sharing';


@IonicPage()
@Component({
    selector: 'page-account',
    templateUrl: 'account.html',
})
export class AccountPage {
    geo = geofirex.init(firebaseApp);
    @ViewChild(Navbar) navBar: Navbar;
    showEditProfile: boolean = false;
    title = 'Account';
    localCopyName: string;
    localCopyPhone: string;
    localCopyAddress: string;
    showSpinner: boolean = false;
    newLat: any;
    newLong: any;
    constructor(
        public navCtrl: NavController,
        public navParams: NavParams,
        public authProvider: AuthProvider,
        public userProvider: UserProvider,
        public ordersProvider: OrdersProvider,
        public cartProvider: CartProvider,
        public alertCtrl: AlertController,
        private afAuth: AngularFireAuth,
        public afs: AngularFirestore,
        public toastProvider: ToastProvider,
        private locationAccuracy: LocationAccuracy,
        private geolocation: Geolocation,
        public openNativeSettings: OpenNativeSettings,
        public commonProvider: CommonProvider,
        private socialSharing: SocialSharing
    ) {
    }

    ionViewDidLoad() {
        this.navBar.backButtonClick = (e: UIEvent) => {
            if (this.showEditProfile) {
                this.userProvider.user.displayName = this.localCopyName;
                this.userProvider.userDoc.phoneNumber = this.localCopyPhone;
                this.userProvider.userDoc.address = this.localCopyAddress;
                this.showEditProfile = false;
                this.title = 'Account'
            } else {
                this.navCtrl.pop();
            }
        }
    }


    logout() {
        this.authProvider.signOut().then(success => {
            this.userProvider.destroy();
            this.ordersProvider.destroy();
            this.cartProvider.destroy();
            console.log('logged out');
        }).catch(error => {
            console.log(error);
        });
    }

    presentLogoutConfirm() {
        if(!this.commonProvider.isOnline){
            this.toastProvider.presentToast('You are offline.', 3000, 'top');
            return;
        }
        let alert = this.alertCtrl.create({
            message: 'Are you sure want to logout?',
            buttons: [
                {
                    text: 'No',
                    role: 'cancel',
                    handler: () => {
                        console.log('Cancel clicked');
                    }
                },
                {
                    text: 'Yes',
                    handler: () => {
                        this.logout();
                    }
                }
            ]
        });
        alert.present();
    }

    edit() {
        this.showEditProfile = true;
        this.title = 'Edit Profile';
        this.localCopyName = JSON.parse(JSON.stringify(this.userProvider.user.displayName));
        this.localCopyAddress = JSON.parse(JSON.stringify(this.userProvider.userDoc.address));
        this.localCopyPhone = JSON.parse(JSON.stringify(this.userProvider.userDoc.phoneNumber));
    }

    validateNumber(number) {
        let regex = /^[\+]?[(]?[0-9]{3}[)]?[-\s\.]?[0-9]{3}[-\s\.]?[0-9]{4,6}$/;
        return regex.test(number.trim());
    }

    save() {
        if(!this.commonProvider.isOnline){
            this.toastProvider.presentToast('You are offline.', 3000, 'top');
            return;
        }
        let obj = {};
        this.showSpinner = true;
        if (this.localCopyName != this.userProvider.user.displayName.trim()) {
            let user = this.afAuth.auth.currentUser;
            user.updateProfile({
                displayName: this.userProvider.user.displayName.trim(),
                photoURL: this.userProvider.user.photoUrl
            }).then(success => {
                console.log('displayName Updated');
                this.showSpinner = false;
                this.toastProvider.presentToast(MessageConstants.DISPLAY_NAME_UPDATED, 2000, 'top');
                this.localCopyName = JSON.parse(JSON.stringify(this.userProvider.user.displayName));
            }).catch(error => {
                this.showSpinner = false;
                this.toastProvider.presentToast(MessageConstants.SOMETHING_WENT_WRONG, 2000, 'top');
                console.log(error);
            });
        }

        if (this.localCopyPhone != this.userProvider.userDoc.phoneNumber.trim()) {
            if(!this.validateNumber(this.userProvider.userDoc.phoneNumber.trim())){
                this.toastProvider.presentToast('Incorrect phone number.', 3000, 'top');
                this.showSpinner = false;
                return;
            }
            obj['phoneNumber'] = this.userProvider.userDoc.phoneNumber.trim();
        }

        if (this.localCopyAddress != this.userProvider.userDoc.address.trim()) {
            if(this.userProvider.userDoc.address.trim().length < 10){
                this.toastProvider.presentToast('Address should contain atleast 10 characters.', 3000, 'top');
                this.showSpinner = false;
                return;
            }
            if(this.userProvider.userDoc.address.trim().length > 250){
                this.toastProvider.presentToast('Max 250 characters allowed.', 3000, 'top');
                this.showSpinner = false;
                return;
            }
            obj['address'] = this.userProvider.userDoc.address.trim();
        }
        console.log(obj);
        if (Object.keys(obj).length) {
            this.showSpinner = true;
            let ref = this.afs.collection(CollectionConstants.USERS).doc(this.userProvider.user.uid).ref;
            ref.set(obj, { merge: true }).then(success => {
                console.log('address / phone number updated', obj);
                this.toastProvider.presentToast(MessageConstants.USER_DETAILS_UPDATED, 2000, 'top');
                this.localCopyAddress = this.userProvider.userDoc.address.trim();
                this.localCopyPhone = this.userProvider.userDoc.phoneNumber.trim();
                this.showSpinner = false;
            }).catch(error => {
                console.log(error);
                this.toastProvider.presentToast(MessageConstants.SOMETHING_WENT_WRONG, 2000, 'top');
                this.showSpinner = false;
            });
        }
    }

    updateBtnState() {
        console.log('update btn')
        if(this.localCopyName != this.userProvider.user.displayName.trim()
        || this.localCopyAddress != this.userProvider.userDoc.address.trim()
        || this.localCopyPhone != this.userProvider.userDoc.phoneNumber.trim()) {
            return false;
        }else{
            return true;
        }
    }

    requestLocation() {
        try {
          this.locationAccuracy.request(this.locationAccuracy.REQUEST_PRIORITY_HIGH_ACCURACY).then(
            () => {
              console.log('success');
              this.toastProvider.presentToast('This might take some time.', 3000, 'top');
              this.getGeoLocation();
            },
            error => {
                //For web
                //this.getGeoLocation()
              console.log('Error requesting location permissions', error);
              this.toastProvider.presentToast('Something went wrong. Make sure GPS is enabled & allow location accuracy.', 3000, 'top');
            }
          );
        } catch (error) {
          console.log(error);
        }
      }
    
      getGeoLocation() {
        this.geolocation.getCurrentPosition().then((resp) => {
          this.newLat = resp.coords.latitude;
          this.newLong = resp.coords.longitude;
    
          let location = this.getLocationHash();
          console.log('location', location);
          if(location){
            let obj = {
                location: location
            }
           let ref = this.afs.collection(CollectionConstants.USERS).doc(this.userProvider.user.uid).ref;
           ref.set(obj, {merge: true})
           .then(success => {
               this.toastProvider.presentToast('Location updated.', 3000, 'top');
           }).catch(error => {
            this.toastProvider.presentToast('Something went wrong.', 3000, 'top');
           })
          }else{
            this.toastProvider.presentToast('Something went wrong.', 3000, 'top');
          }
        }).catch((error) => {
          console.log('Error getting location', error);
          this.toastProvider.presentToast('Something went wrong. Make sure GPS is enabled & allow location accuracy.', 3000, 'top');
        });
      }

      getLocationHash() {
        if (this.newLat && this.newLong) {
          const point = this.geo.point(this.newLat, this.newLong);
          console.log('geoPoint', point.data);
          return point.data;
        }else{
          console.log('Lat long not available');
          return;
        }
      }

      showAboutPage(){
          this.navCtrl.push('AboutPage');
      }

      showFaqPage(){
        window.open("https://alienart.in/products/anvigo/consumer/faq/", '_system', 'location=yes');
      }

      feedback(){
        window.open("mailto:alientartsoftwares@gmail.com", '_system');
      }

      share(){
        let subject = 'Download Anvigo App';
        let msg = 'Order monthly groceries from your favorite store. Find exciting offers near you.'
        let img = this.getConsumerImage();
        let link = 'https://play.google.com/store/apps/details?id=in.alienart.anvigo.consumer';
        console.log(subject);
        this.socialSharing.share(msg, subject, img, link).then(() => {
          console.log('shared');
        }).catch(error => {
          console.log(error);
        });
      }

      getConsumerImage(){
        return 'data:image/jpeg;base64,';
      }



}
